import { Card, EmptyState, Layout, Page } from '@shopify/polaris';


const Bing = () => (
    <Page>
        <Layout>
            <Card sectioned>
                <p>Whee</p>
            </Card>
        </Layout>
    </Page>
);

export default Bing;
